import BasicText from "..//atoms/BasicText"
import React from "react";




const InputFeild: React.FC = ()=> {
    return (
    <div>

                
       <BasicInput name="levelCode"/> <br/>
       <BasicInput name="levelName" /><br/>
       <BasicInput name ="levelDescription"/>
    </div>
  
  
    );
  }
  export default InputFeild;
